import React from 'react';
import styles from './index.module.css';

function Result(props) {

	const typeDesc = [];
	const [render, setRender] = React.useState(false);

	if (props.status === 3 && props.types !== null) {
			typeDesc.push(props.types.split('_'));

		if (typeDesc[1] === '결과지향자') typeDesc.push(['DISC', 'DICS'].join(' / ')); 
		if (typeDesc[1] === '성취자') typeDesc.push(['DSCI', 'DSIC'].join(' / ')); 
		if (typeDesc[1] === '개척가') typeDesc.push(['DCIS', 'DCSI'].join(' / ')); 
		if (typeDesc[1] === '정치가') typeDesc.push(['IDSC', 'IDCS'].join(' / ')); 
		if (typeDesc[1] === '헌신자') typeDesc.push(['ISDC', 'ISCD'].join(' / ')); 
		if (typeDesc[1] === '협상가') typeDesc.push(['ICDS', 'ICSD'].join(' / ')); 
		if (typeDesc[1] === '디자이너') typeDesc.push(['SDCI', 'SDIC'].join(' / ')); 
		if (typeDesc[1] === '상담가') typeDesc.push(['SICD', 'SIDC'].join(' / ')); 
		if (typeDesc[1] === '관리자') typeDesc.push(['SCID', 'SCDI'].join(' / ')); 
		if (typeDesc[1] === '설계자') typeDesc.push(['CDSI', 'CDIS'].join(' / ')); 
		if (typeDesc[1] === '작가') typeDesc.push(['CISD', 'CIDS'].join(' / ')); 
		if (typeDesc[1] === '원칙주의자') typeDesc.push(['CSDI', 'CSID'].join(' / '));

	}
	
